import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => (
    <div style = {styles.navBarStyle}>

        <div style={styles.appNameContainerStyle}>
            <h4 style= {styles.appNameStyle}>CoAuthor</h4>
        </div>

        <input style = {styles.searchStyle} placeholder="Search anything dude"/>

        <ul style = {styles.listContainer}>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/'>
                    Home
                </Link>
            </li>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/signin'>
                    Sign In
                </Link>
            </li>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/signup'>
                    Sign Up
                </Link>
            </li>
        </ul>
    </div>
);

const styles = {
    navBarStyle: {
        height: '10vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'row',
        backgroundColor: '#FAFAFA'
    },
    listStyle: {
        display: 'inline',
        padding: 20
    },
    listContainer: {
        flexBasis: '33%',
        display: 'flex',
        justifyContent: 'flex-end'
    },
    textStyle: {
        textDecoration: 'none',
        color: '#454545',
        fontFamily: 'merriweather'
    },
    searchStyle: {
        flexBasis: '33%',
        border: 'none',
        height: 40,
        borderRadius: 8,
        boxShadow: '5px 40px 40px -4px #b6b6b6'
    },
    appNameContainerStyle: {
        display: 'flex',
        justifyContent: 'center',
        flexBasis: '34%'
    },
    appNameStyle: {
        fontFamily: 'merriweather'
    }
}

export default Navigation;
